import React, {useState, useEffect} from 'react'
import { Grid } from "@material-ui/core"
import { makeStyles } from "@material-ui/core/styles"

const useStyles = makeStyles(() => ({
    card: {
      borderRadius: '1rem',
      boxShadow: 'none',
      position: 'relative',
      minWidth: 200,
      minHeight: 360,
      '&:after': {
        content: '""',
        display: 'block',
        position: 'absolute',
        width: '100%',
        height: '64%',
        bottom: 0,
        zIndex: 1,
        background: 'linear-gradient(to top, #000, rgba(0,0,0,0))',
      },
    },
    content: {
      position: 'absolute',
      zIndex: 2,
      bottom: 0,
      width: '100%',
    },
  }));

const TeamMember = React.memo(function GalaxyCard() {
    const mediaStyles = useCoverCardMediaStyles({ bgPosition: 'top' });
    const styles = useStyles();
    return (
      <>
        <NoSsr>
          <GoogleFontLoader
            fonts={[
              { font: 'Spartan', weights: [300] },
              { font: 'Montserrat', weights: [200, 400, 700] },
            ]}
          />
        </NoSsr>
        <Card className={styles.card}>
          <CardMedia
            classes={mediaStyles}
            image={
              'https://image-us.samsung.com/SamsungUS/home/audio/galaxy-buds/MB-04-JustWhatYouWantV4.jpg?$cm-g-fb-full-bleed-img-mobile-jpg$'
            }
          />
          <Box py={3} px={2} className={styles.content}>
            <Info useStyles={useGalaxyInfoStyles}>
              <InfoSubtitle>Galaxy</InfoSubtitle>
              <InfoTitle>Buds 2019</InfoTitle>
              <InfoCaption>Perfect for everyone</InfoCaption>
            </Info>
          </Box>
        </Card>
      </>
    );
  });

export default TeamMember
